import React from "react";
import Navbar from "./navbar/Navbar";
import { Route, Routes } from "react-router-dom";
import "./app.less";
import Registration from "./registration/Registration";

function App() {
  return (
    <div className="app">
      <Navbar />
      <div className="wrap">
        <Routes>
          <Route path="/registration" component={Registration} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
